class Solution:
    def checkXMatrix(self, grid: list[list[int]]) -> bool:
        len_g = len(grid)
        for r in range(len_g):
            for c in range(len_g):
                if (r==c and (grid[r][c] == 0 or grid[r][-(c+1)] == 0)):
                    return False
                if not(r==c  or c == len_g-r-1 ) and grid[r][c] != 0:
                    return False
         
        return True    


                

